latestPosts.caption:
Summing up my whole wedding experience in this short clip. 
We met as friends which slowly turned into a thing and through the pandemic we managed to get engaged and now we are husband and wife. Dating for 14 years, we have always been asked why aren’t we married yet. But we always felt that when the time comes we will know and we surely did. We hope this new chapter of our lives will be as colourful as it was. When you marry your soulmate, what more can you ask for. ♥️♾️ 

p.s: Watching this video is bringing back all the emotions I felt that day. 

